(function($, w, d, undefined) {

  function typewriter() {

    // Globals 
    var self = this, speed;

    function init(element, options) {
            // Set Globals
      var str;
      var indice = 0;

      self.options = $.extend( {}, $.fn.typewriter.options, options );
      $currentElement = $(element);
      elementStr = $currentElement.text().replace(/\s+/g, ' ');
      dataSpeed  = $currentElement.data("speed") || self.options.speed;
      $currentElement.empty();
      var showText = setInterval(
				function(){
					if (indice++ < elementStr.length) {
			      $currentElement.append(elementStr[indice]);
			    }else{
			    	clearInterval(showText);
			    }
				}, dataSpeed);
      // self.animation = setInterval(function(){animate_calification()}, 20);
    }

    
    
    // Metodos publicos
    return {
      init: init
    }
  }

  // Plugin jQuery
  $.fn.typewriter = function(options) {
    return this.each(function () {
    	var writer =  new typewriter();
      writer.init(this, options);
      $.data( this, 'typewriter', writer);
    });
  };

  $.fn.typewriter.options = {
    'speed' : 300
  };

})(jQuery, window, document);

var jio_data_img = {
  
  // $img is in view (true | false)
  inview : function($img){
    var w = $(window);
    if(w.scrollTop() + w.height() <= $img.offset().top){ return false; }
    else if (w.scrollTop() >= $img.offset().top + $img.height()){ return false; }
    else { return true; }
  },
  
  // placeholder load $img
  replace: function($img) {
    var $imgSrc = $img.attr('data-src'),
      $imgBg = $img.attr('data-bg'),
      $imgSrcset = $img.attr('data-srcset'),
      $imgSizes = $img.attr('data-sizes'),
      $imgPlaceholder = new Image();
      
      $img.removeAttr('data-src data-bg data-srcset data-sizes');

    if (typeof $imgSrc !== 'undefined') {
      $imgPlaceholder.src = $imgSrc;
      $imgPlaceholder.onload = function() {
        $img.removeClass('loading').attr('src', $imgSrc);
      };
    };

    if (typeof $imgSrcset !== 'undefined') {
      $imgPlaceholder.srcset = $imgSrcset;
      $imgPlaceholder.sizes = $imgSizes;
      $imgPlaceholder.onload = function() {
        $img.removeClass('loading').attr('srcset', $imgSrcset).attr('sizes', $imgSizes);
      };
    }

    if (typeof $imgBg !== 'undefined') {
      $imgPlaceholder.src = $imgBg;
      $imgPlaceholder.onload = function() {
        $img.removeClass('loading').css({
          backgroundImage: 'url(' + $imgBg + ')',
        });
      };
    };
  },
  
  // scan DOM for replacable img srcses
  scan : function(){
    $('[data-src], [data-bg], [data-srcset], [data-sizes]').each(function(e){
      var $img = $(this);  
      if(jio_data_img.inview($img)){
        jio_data_img.replace($img);
      }
    });
  },
  
  // Initiate on each event in array
  init : function(events){
    if ($.isArray(events)){
      events.forEach(function(event){
        $(window).on(event,function(){
          jio_data_img.scan();
        });
      });
    }
  }
}

// Lesgo!
jio_data_img.init(['load','scroll','resize']);

var checkSuccess = function(target){

    if(target.val() === ''){target.removeClass('success').next('label').removeClass('stayup');}

    else if(target.is('input[type="checkbox"], input[type="radio"]')){}

    else{target.addClass('success').next('label').addClass('stayup');}

}

var formHandleResponse = function(response,form){

    form.removeClass('loading');

    if(response.success){
        if(!form.find('.form-success').length){
            var $formSucces = $('<div class="form-success"></div>');
            form.html($formSucces);
        }

        form.find('.form.error').remove();
        form.find('.form-success').html(response.success);
        form.addClass('success');
    }

    if(response.error){
        if(!form.find('.form-error').length){
            var $formError = $('<div class="form-error"></div>');
            form.append($formError);
        }

        form.find('.form-error').html(response.error);
        form.addClass('error');

    }

}

var validateForm = function(form){

    var ready = true;

    form.find('input').each(function(){

        if($(this).hasClass('error')){
            ready = false;
        }

    });

    if (ready){
        return true;
    }
    else{
        return false
    }
}

var validateEmail = function(email) {
    var re = /^([\w-]+(?:\.[\w-]+)*)@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,6}(?:\.[a-z]{2})?)$/i;
    return re.test(email);
}

var formJsInit = function(){

    $('form input, form textarea').each(function(){
        checkSuccess($(this));
    });

    autosize($('form textarea:not(.no-autosize):visible'));

    // Check for allerede udfyldt felter ved sideload
    $('form input, form textarea').each(function(){
        var target = $(this);
        checkSuccess(target);
    });

    // Kosmetisk opdatering ved blur
    $('form input, form textarea').off().on('blur',function(e){
        var target = $(e.target);

        // Fjern error
        target.removeClass('error');

        // Check om feltet er tomt
        checkSuccess(target);

        if(target.is('input[type="email"]') && target.val() !== ''){

            if(!validateEmail(target.val())){

                target.addClass('error');
            }


        }

    });


    $('form').off().on({

        keyup : function(e){

            var target = $(e.target);

            // Fjern error og success
            target.removeClass('error').removeClass('success');

            if(target.is('input[type="number"]')){

                var value = target.val().replace(/[^0-9]/g, '');

                target.val(value);

            }

        },

        click : function(e){
            var t = $(e.target);

            if(t.is('.front-form-expand')){
                e.preventDefault();
                t.hide();
                $(this).addClass('active').animate({opacity: 1},200);
                $('.front-form').find('.hidden').removeClass('hidden');
                $('html,body').animate({scrollTop: $('.front-form').offset().top - $('.site-header').height()});
                autosize($('form textarea:not(.no-autosize):visible'));
                
               
            }
            
            if(t.is('.submit')){
                e.preventDefault();


                var form = t.parents('form'),
                    action = form.attr('action'),
                    formData = form.serialize();

                if(validateForm(form) && !form.hasClass('loading') && !form.hasClass('success')){

                    form.addClass('loading');

                    $.ajax({
                                url : action,
                                type : 'POST',
                                data : formData,
                                dataType : 'json',
                                success : function(response){
                                    formHandleResponse(response,form);
                                },
                            });

                }
            }
        }
     });

}

$(function(){

    formJsInit();

});


$('.hero-banner').on('click',function(e){
    
    e.preventDefault();

    var t = $(e.target),
        activeSlide = $('.hero-banner-item.active'),
        active = activeSlide.index() + 1,
        slideTotal = $('.hero-banner-item').length,
        activeDot = $('.hero-banner-dots .active');

    if(t.is('.nav-left, .nav-left *')){
         
        if(active === 1){
            activeSlide.removeClass('active');
            activeDot.removeClass('active');
            $('.hero-banner-item:nth-child('+slideTotal+')').addClass('active');
            $('.hero-banner-dots li:nth-child('+slideTotal+')').addClass('active');
        }
        else{
            activeSlide.removeClass('active').prev().addClass('active');
            activeDot.removeClass('active').prev().addClass('active');
        }
    }
    
    if(t.is('.nav-right, .nav-right *')){
           
        if(active === slideTotal){
            activeSlide.removeClass('active');
            activeDot.removeClass('active');
            $('.hero-banner-item:nth-child(1)').addClass('active');
            $('.hero-banner-dots li:nth-child(1)').addClass('active');
        }
        else{
            activeSlide.removeClass('active').next().addClass('active');
            activeDot.removeClass('active').next().addClass('active');
        }    
    }
    
    if(t.is('.dot a')){
        
        var p = t.parent('li').index() + 1;
        
        activeSlide.removeClass('active');
        activeDot.removeClass('active');
        
        $('.hero-banner-item:nth-child('+p+')').addClass('active');
        $('.hero-banner-dots li:nth-child('+p+')').addClass('active'); 
    }
    
    if(t.is('.hero-banner-pages a, .hero-banner-item-title a')){
        window.location.href = t.attr('href');
    }

});

if($('.contact-face-spinner').length){
    
    var fs_nav_buffer = false,
        fs_top = $('.face-spinner-top'),
        fs_middle = $('.face-spinner-middle'),
        fs_bottom = $('.face-spinner-bottom'),
        flickitySettings = {
            wrapAround : true,
            pageDots : false,
            prevNextButtons : false,
        };
    
    function FScheckForMatch(){
        
        var top = $('.face-spinner-top .slice.is-selected').attr('data-slice-id'),
            middle = $('.face-spinner-middle .slice.is-selected').attr('data-slice-id'),
            bottom = $('.face-spinner-bottom .slice.is-selected').attr('data-slice-id'),
            post = $('.face-spinner-top .slice.is-selected').attr('data-post-id');
        
        if(top === middle && middle === bottom){
            $('.contact-face-spinner').addClass('match');
            
            $('.contact-spinner').addClass('show-article').on('click',function(e){
                if($(e.target).is('article.visible, article.visible *')){
                    $('.contact-spinner').removeClass('show-article');
                }
                
            });
            
            $('.contact-spinner article.visible').removeClass('visible').addClass('hidden');
            $('.contact-spinner article.post-'+post).removeClass('hidden').addClass('visible')
            
            // delay navigation 
            fs_nav_buffer = true;
            setTimeout(function(){
                fs_nav_buffer = false;
            },100);
        }
        
        else{
            $('.contact-face-spinner').removeClass('match');
        }
    }
    

    
    
    fs_top.flickity(flickitySettings).on('cellSelect',function(){FScheckForMatch()});
    
    //flickitySettings.initialIndex = 1;
    fs_middle.flickity(flickitySettings).on('cellSelect',function(){FScheckForMatch()});
    
    //flickitySettings.initialIndex = 2;
    fs_bottom.flickity(flickitySettings).on('cellSelect',function(){FScheckForMatch()});
    
    
    $('.face-spinner-controls').on('click',function(e){
        e.preventDefault();
        var t = $(e.target);
        
        if(t.is('.spin-top, .spin-top *')){
            fs_top.flickity('next');
        }
        
        if(t.is('.spin-middle, .spin-middle *')){
            fs_middle.flickity('next');
        }
        
        if(t.is('.spin-bottom, .spin-bottom *')){
            fs_bottom.flickity('next');
        }
        
    });
    
    $('.contact-face-spinner').on('click',function(e){
        if($(this).hasClass('match') && !fs_nav_buffer){
            var t = $(e.target);
            if(!t.is('.face-spinner-controls, .face-spinner-controls *')){
                
                var path = $(this).find('.slice.is-selected').attr('data-slice-url');
                window.location.href = path;
                
            }
        }
    });
}

